import { Slider, List, ListItem } from '@mui/material';

const TuningPanel = ({ onUserChangeTuningData, TuningData }) => {
    return (
        <div>
            <List>
                <ListItem>
                    <Slider
                        disabled={false}
                        marks={false}
                        step={0.1}
                        max={10}
                        min={1}
                        size="small"
                        valueLabelDisplay="on"
                        onChange={onUserChangeTuningData}
                    />
                </ListItem>
                <ListItem>
                    <Slider
                        disabled={false}
                        marks={false}
                        step={0.1}
                        max={10}
                        min={1}
                        size="small"
                        valueLabelDisplay="on"
                        onChange={onUserChangeTuningData}
                    />
                </ListItem>
            </List>
        </div>
    )
}

export default TuningPanel;
